var values = [1,2,3,4,5,6,7,8,9];

//value is the value of the cell, 0 for null.
//marks is the list of pencil marks
function Cell(value, marks) {
    this.value = value;
    this.marks = marks;
}

var generatePuzzle = function()
{
	grid = new Array(9);
	for(var i=0; i<grid.length; i++)
		grid[i] = new Array(9);
	var offset =0;
	
	//generate trivial sudoku solution
	for(var i=0; i<9; i++)
	{
		for(var j=0; j<9; j++)
		{
			grid[i][j] = new Cell((j+offset)%9+1, []);
		}
		offset+=3;
		if(i%3==2)
			offset+=1;
	}
	
	//randomize the solution
	grid = randomize(grid,1000);
}

//grid as number matrix... no use of cell class
//needs to be reworked to generate valid sudoku grids
var randomize = function(grid, steps)
{
	
	for(var step=0; step<steps; step++)
	{
		//randomly choose the type of permutation
		random = Math.round(Math.random()*3);
		
		
		var T = transpose(grid);
		
		for(var i=0; i<9; i++)
		{
			console.log(grid[i].toString());
		}
		
		switch(random)
		{
			case 0: //switch the symbols used in the board
			var symbols = draw(values,2); //swap the values
			for(var i=0; i<9; i++)
				for(var j=0; j<9; j++)
				{
					if(grid[i][j]===symbols[1])
						grid[i][j] = symbols[0];
					else if(grid[i][j]===symbols[0])
						grid[i][j] = symbols[1];
				}
			break;
			case 1: //switch the rows
			var rows = draw(values,2);
			//subtract 1 from each
			rows = rows.map(e=>e-1);
			
			//swap
			temp = cloneArray(grid[rows[0]]);
			grid[rows[0]] = cloneArray(grid[rows[1]]);
			grid[rows[1]] = temp;
			break;
			case 2: //switch the columns
			var cols = draw(values,2);
			//subtract 1 from each
			cols = cols.map(e=>e-1);
			
			//swap
			temp = cloneArray(T[cols[0]]);
			T[cols[0]] = cloneArray(T[cols[1]]);
			T[cols[1]] = temp;
			grid = transpose(T);
			break;
			
			case 3: //transpose (inefficient)
			grid = T;
			break;
		}
	}
	return grid;
}

//REDO TO MAKE O(n/2)
var draw = function(list, number)
{
	var currentIndex = list.length-1., result=[];
	list = cloneArray(list);
	while(currentIndex>=0&&result.length<number)
	{
		var draw = Math.round(Math.random()*currentIndex);
		result.push(list[draw]);
		list.splice(draw,1);
		currentIndex--;
	}
	return result;
}

var transpose = function(matrix)
{
	matrix = cloneMatrix(matrix);
	var T = new Array(9);
		
	for(var i=0; i<matrix.length; i++)
	{
		T[i] = new Array(9);
		for(var j=0; j<matrix[i].length; j++)
			T[i][j] = matrix[j][i];
	}
	return T;
}

