//deep-clones the board matrix
var cloneArray = function(array)
{
	var arr = [];
	for(var i=0; i<array.length; i++)
		arr.push(array[i]);
	return arr;
}

var cloneMatrix = function(matrix)
{
	var mat = [];
	for(var i=0; i<matrix.length; i++)
	{
		mat.push([]);
		for(var j=0; j<matrix[i].length; j++)
			mat[i].push(matrix[i][j]);
	}
	return mat;
}

