//returns string array
var process = function(string){
	var arr = string.split("\n");
	var unrolled = arr[Math.round(Math.random()*(arr.length-1))].split('');
	var rolled = new Array(9);
	for(var i=0; i<9; i++)
	{
		rolled[i] = [];
		for(var j=0; j<9; j++)
			rolled[i].push(parseInt(unrolled[j+i*9]));
	}
	setGrid(rolled);
}

